from typing import List

class Solution:
    def maximumSumOfHeights(self, maxHeights: List[int]) -> int:
        n = len(maxHeights)
        preMax = [0] * n
        st = [-1]
        s = 0
        for i in range(n):
            x = maxHeights[i]
            while len(st) > 1 and maxHeights[st[-1]] >= x:
                j = st.pop()
                s -= maxHeights[j] * (j - st[-1])
            s += x * (i - st[-1])
            st.append(i)
            preMax[i] = s

        posMax = [0] * n
        posMax[n-1] = maxHeights[n-1]
        st = [n]
        s = 0
        for i in range(n-1, -1, -1):
            x = maxHeights[i]
            while len(st) > 1 and maxHeights[st[-1]] >= x:
                j = st.pop()
                s -= maxHeights[j] * (st[-1] - j)
            s += x * (st[-1] - i)
            st.append(i)
            posMax[i] = s

        ans = 0
        for i in range(n):
            ans = max(ans, preMax[i] + posMax[i] - maxHeights[i])
        # print(ans)
        return ans

